                        <h2><span style=""color: #000000; font-size: 14pt;""><strong>Giới thiệu về Tour Rẻ</strong></span></h2>
                        <p><span style=""font-size: 10pt;""><strong>Tour Rẻ</strong>&nbsp;được thành lập vào tháng 10 năm 2020 bởi những con người yêu du lịch với mục tiêu cung cấp các thông tin du lịch hữu ích và những sản phẩm du lịch chất lượng cao giá rẻ&nbsp; đến với khách hàng.</span></p>
                        <h2><span style=""color: #000000; font-size: 12pt;""><strong>1. Giới thiệu về Tour Rẻ</strong></span></h2>");
            WriteLiteral(@"
                        <p><span style=""font-size: 10pt;""><strong><em>1.1 Sứ mệnh Tour Rẻ</em></strong></span></p>
                        <p><span style=""font-size: 10pt;"">Tourre.vn chia sẻ những thông tin hữu ích và chính xác nhất về điểm đến du lịch tại Việt Nam. Tourre.vn mong muốn tất cả du khách có một góc nhìn chân thực về du lịch nhằm giúp khách hàng có những trải nghiệm du lịch tuyệt vời nhất. Mục đích cuối cùng là để nâng cao chất lượng ngành du lịch Việt Nam so với các quốc gia khác trên thế giới.</span></p>
                        <p><span style=""font-size: 10pt;""><strong><em>1.2 Tầm nhìn Tour Rẻ</em></strong></span></p>
                        <p><span style=""font-size: 10pt;"">Tourre.vn có mục tiêu trở thành website về du lịch hàng đầu Việt Nam. Với đội ngũ nhân viên trình độ và tâm huyết, tourre.vn sẽ cố gắng đạt được mục tiêu này trong vòng 10 năm.</span></p>
                        <h2><span style=""color: #000000; font-size: 12pt;""><strong>2. Dịch vụ cung cấp bởi Tour Rẻ</strong></span></");
            WriteLiteral(@"h2>
                        <ul>
                            <li><span style=""font-size: 10pt;"">Cung cấp các thông tin, cẩm nang du lịch về các điểm đến tại Việt Nam như: Hà Nội, Ninh Bình, Hạ Long, Sapa, ..</span></li>
                            <li><span style=""font-size: 10pt;"">Tổ chức tour du lịch trong nước</span></li>
                            <li><span style=""font-size: 10pt;"">Đặt vé máy bay, vé tàu giá rẻ</span></li>
                            <li><span style=""font-size: 10pt;"">Đặt phòng khách sạn giá rẻ</span></li>
                            <li><span style=""font-size: 10pt;"">Cho thuê xe du lịch giá rẻ</span></li>
                        </ul>
                        <h2><span style=""color: #008000; font-size: 12pt;""><strong><span style=""color: #000000;"">3. Đối tác của Tour Rẻ</span></strong></span></h2>
                        <ul>
