            WriteLiteral(@"i Tử Long</span></li>
                            <li><span style=""font-size: 10pt;"">Hơn 100 khách sạn trên toàn Việt Nam</span></li>
                            <li><span style=""font-size: 10pt;"">Đại lý vé máy bay: Vietnamairline/ Vietjetair/ Bambooairway / Jetstar</span></li>
                            <li><span style=""font-size: 10pt;"">Đại lý của Vinpearl / Vinpearlland/ Vinpearl resort</span></li>
                        </ul>
